Wolverine and the X-Men is an animated television series. It's the fourth animated adaptation of the X-Men characters, the other three being &quot;Pryde of the X-Men&quot;, X-Men: The Animated Series and X-Men: Evolution. After an attack on the mansion, Professor Charles Xavier and Jean Grey are missing. The X-Men disband and Scott begins to suffer from depression. Emma Frost is able to locate a comatose Charles on Genosha in the care of Magneto. Professor X telepathically orders Wolverine to lead the X-Men and set out to save the world from The Sentinel Project and prevent the Brotherhood of Mutants from taking over the world before the future ends up a bad one.
